    <div className="button-primary-ndart-icon-text border-1px-caribbean-green">
      <EditPlus editPlus={editPlusProps.editPlus} />
      <div className="button-i6132480354 valign-text-middle ibmplexsans-semi-bold-shark-16px">{buttonI6132480354}</div>
    </div>
  );
}

export default ButtonPrimaryStandartIconText;
